import React from "react";
import {FooterStyled} from "./styles/Footer.styled";

export const Footer = () => {
    return (
        <FooterStyled>
            <span>
                <h5>Cocktails &copy;</h5>
            </span>
            <span>
                <h5>
                    {
                    document.write('hi')
                    }
                </h5>
            </span>
        </FooterStyled>
    )
}
